import React from 'react';
import './Styles.css';

const OfferSection = () => {
  return (
    <section className="offer-section">
      <div className="offer-content">
        <span className="offer-title">What We Offer</span>
        
        <p className="offer-comparison">
        We offer high-quality work, timely delivery, customized solutions, competitive pricing, and excellent communication. Our team ensures exceptional results that align with your vision. We prioritize open and clear communication, tailored strategies, and fair pricing. Partner with us for reliable service and achieve your goals efficiently.
        </p>
      </div>
    </section>
  );
};

export default OfferSection;
